// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract OwlPresale {
    // State Variables
    address public owner;
    address public multisig;
    address public owlToken;
    address public usdtToken;

    uint256 public price; // price in wei per OWL token
    uint256 public cap = 1_000_000_000 * 1e18; // 1B OWL tokens
    uint256 public totalSold;
    bool public tgeStarted;
    bool public paused;
    bool public claimEnabled;

    // Reentrancy guard
    bool private _locked;

    // Mapping to track purchases and claims
    mapping(address => uint256) public purchased;
    mapping(address => uint256) public claimed;

    // Events
    event Purchased(address indexed buyer, uint256 owlAmount, uint256 paidAmount, string paymentMethod);
    event Claimed(address indexed buyer, uint256 amount);
    event TGEStarted();
    event ClaimEnabled();
    event PriceUpdated(uint256 newPrice);
    event EmergencyWithdraw(address token, uint256 amount);
    event Paused();
    event Unpaused();
    event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);
    event MultisigUpdated(address indexed newMultisig);

    // Modifiers
    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    modifier nonReentrant() {
        require(!_locked, "Reentrant call");
        _locked = true;
        _;
        _locked = false;
    }

    modifier whenNotPaused() {
        require(!paused, "Contract is paused");
        _;
    }

    // Constructor
    constructor() {
        // Set your addresses here before deployment
        owlToken = 0x897c2Cf8c22E279e29AdA4D11F08A60A89a68944;    
        usdtToken = 0x871bE0F2a2A816AfF98032d84bC84CdFCD28ABBA;   
        multisig = 0x385baB7d63d6142791FcC81E4d05ADc6530c6763;    
        price = 500000000000000;                                

        // Validate addresses (will fail if you don't replace the zero addresses)
        require(owlToken != address(0), "Set OWL token address");
        require(usdtToken != address(0), "Set USDT token address");
        require(multisig != address(0), "Set multisig address");
        require(price > 0, "Set price");

        // Set ownership to multisig
        owner = multisig;
        emit OwnershipTransferred(address(0), multisig);
    }

    // Price setting function
    function setPrice(uint256 _price) external onlyOwner {
        require(_price > 0, "Price must be > 0");
        price = _price;
        emit PriceUpdated(_price);
    }

    // Buy with ETH - Updated version with explicit ETH amount parameter
    function buyWithETH(uint256 ethAmount) external payable nonReentrant whenNotPaused {
        require(!tgeStarted, "TGE started");
        require(price > 0, "Price not set");
        require(ethAmount > 0, "ETH amount must be > 0");
        require(msg.value >= ethAmount, "Insufficient ETH sent");

        // Calculate OWL tokens to receive based on specified ETH amount
        uint256 owlAmount = (ethAmount * 1e18) / price;
        require(owlAmount > 0, "Amount too small");
        require(totalSold + owlAmount <= cap, "Presale cap reached");

        // Update state first
        purchased[msg.sender] += owlAmount;
        totalSold += owlAmount;

        // Transfer the specified ETH amount to multisig
        (bool success, ) = payable(multisig).call{value: ethAmount}("");
        require(success, "ETH transfer failed");

        // Refund excess ETH if any
        uint256 excessETH = msg.value - ethAmount;
        if (excessETH > 0) {
            (bool refundSuccess, ) = payable(msg.sender).call{value: excessETH}("");
            require(refundSuccess, "ETH refund failed");
        }

        // If claim is enabled and TGE started, transfer tokens immediately
        if (claimEnabled && tgeStarted) {
            _transferTokens(msg.sender, owlAmount);
        }

        emit Purchased(msg.sender, owlAmount, ethAmount, "ETH");
    }

    // Alternative function to buy with all sent ETH (for backward compatibility)
    function buyWithAllETH() external payable nonReentrant whenNotPaused {
        require(!tgeStarted, "TGE started");
        require(price > 0, "Price not set");
        require(msg.value > 0, "Must send ETH");

        // Calculate OWL tokens to receive
        uint256 owlAmount = (msg.value * 1e18) / price;
        require(owlAmount > 0, "Amount too small");
        require(totalSold + owlAmount <= cap, "Presale cap reached");

        // Update state first
        purchased[msg.sender] += owlAmount;
        totalSold += owlAmount;

        // Transfer ETH to multisig
        (bool success, ) = payable(multisig).call{value: msg.value}("");
        require(success, "ETH transfer failed");

        // If claim is enabled and TGE started, transfer tokens immediately
        if (claimEnabled && tgeStarted) {
            _transferTokens(msg.sender, owlAmount);
        }

        emit Purchased(msg.sender, owlAmount, msg.value, "ETH");
    }

    // Buy with USDT
    function buyWithUSDT(uint256 amountUSDT) external nonReentrant whenNotPaused {
        require(!tgeStarted, "TGE started");
        require(price > 0, "Price not set");
        require(amountUSDT > 0, "Must specify USDT amount");

        // Calculate OWL tokens to receive
        uint256 owlAmount = (amountUSDT * 1e18) / price;
        require(owlAmount > 0, "Amount too small");
        require(totalSold + owlAmount <= cap, "Presale cap reached");

        // Transfer USDT from user to multisig using low-level call
        (bool success, bytes memory data) = usdtToken.call(
            abi.encodeWithSignature("transferFrom(address,address,uint256)", msg.sender, multisig, amountUSDT)
        );
        require(success && (data.length == 0 || abi.decode(data, (bool))), "USDT transfer failed");

        // Update state
        purchased[msg.sender] += owlAmount;
        totalSold += owlAmount;

        // If claim is enabled and TGE started, transfer tokens immediately
        if (claimEnabled && tgeStarted) {
            _transferTokens(msg.sender, owlAmount);
        }

        emit Purchased(msg.sender, owlAmount, amountUSDT, "USDT");
    }

    // Internal function to transfer tokens
    function _transferTokens(address to, uint256 amount) internal {
        (bool success, bytes memory data) = owlToken.call(
            abi.encodeWithSignature("transfer(address,uint256)", to, amount)
        );
        require(success && (data.length == 0 || abi.decode(data, (bool))), "Token transfer failed");
        claimed[to] += amount;
        emit Claimed(to, amount);
    }

    // Claim tokens (for users who bought before TGE)
    function claimTokens() external nonReentrant {
        require(tgeStarted, "TGE not started");
        require(claimEnabled, "Claim not enabled");

        uint256 claimableAmount = purchased[msg.sender] - claimed[msg.sender];
        require(claimableAmount > 0, "No tokens to claim");

        _transferTokens(msg.sender, claimableAmount);
    }

    // Start TGE
    function startTGE() external onlyOwner {
        require(!tgeStarted, "TGE already started");
        tgeStarted = true;
        emit TGEStarted();
    }

    // Enable claiming
    function enableClaim() external onlyOwner {
        require(tgeStarted, "TGE must be started first");
        require(!claimEnabled, "Claim already enabled");
        claimEnabled = true;
        emit ClaimEnabled();
    }

    // View functions
    function getRemainingTokens() external view returns (uint256) {
        return cap - totalSold;
    }

    function getClaimableTokens(address user) external view returns (uint256) {
        return purchased[user] - claimed[user];
    }

    function getOwlAmountForETH(uint256 ethAmount) external view returns (uint256) {
        if (price == 0) return 0;
        return (ethAmount * 1e18) / price;
    }

    function getOwlAmountForUSDT(uint256 usdtAmount) external view returns (uint256) {
        if (price == 0) return 0;
        return (usdtAmount * 1e18) / price;
    }

    function getETHAmountForOwl(uint256 owlAmount) external view returns (uint256) {
        if (price == 0) return 0;
        return (owlAmount * price) / 1e18;
    }

    function getUSDTAmountForOwl(uint256 owlAmount) external view returns (uint256) {
        if (price == 0) return 0;
        return (owlAmount * price) / 1e18;
    }

    // Emergency functions
    function pause() external onlyOwner {
        require(!paused, "Already paused");
        paused = true;
        emit Paused();
    }

    function unpause() external onlyOwner {
        require(paused, "Not paused");
        paused = false;
        emit Unpaused();
    }

    function emergencyWithdrawETH() external onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "No ETH to withdraw");

        (bool success, ) = payable(multisig).call{value: balance}("");
        require(success, "ETH withdrawal failed");

        emit EmergencyWithdraw(address(0), balance);
    }

    function emergencyWithdrawToken(address token) external onlyOwner {
        require(token != address(0), "Invalid token address");

        // Get balance using low-level call
        (bool success, bytes memory data) = token.staticcall(
            abi.encodeWithSignature("balanceOf(address)", address(this))
        );
        require(success, "Failed to get balance");
        uint256 balance = abi.decode(data, (uint256));
        require(balance > 0, "No tokens to withdraw");

        // Transfer using low-level call
        (bool transferSuccess, bytes memory transferData) = token.call(
            abi.encodeWithSignature("transfer(address,uint256)", multisig, balance)
        );
        require(transferSuccess && (transferData.length == 0 || abi.decode(transferData, (bool))), "Token withdrawal failed");

        emit EmergencyWithdraw(token, balance);
    }

    // Update multisig address
    function updateMultisig(address newMultisig) external onlyOwner {
        require(newMultisig != address(0), "Invalid multisig address");
        multisig = newMultisig;
        emit MultisigUpdated(newMultisig);
    }

    // Transfer ownership
    function transferOwnership(address newOwner) external onlyOwner {
        require(newOwner != address(0), "Invalid new owner");
        emit OwnershipTransferred(owner, newOwner);
        owner = newOwner;
    }

    // Utility functions
    function isOwner(address account) external view returns (bool) {
        return account == owner;
    }

    function getContractETHBalance() external view returns (uint256) {
        return address(this).balance;
    }

    function getContractTokenBalance(address token) external view returns (uint256) {
        (bool success, bytes memory data) = token.staticcall(
            abi.encodeWithSignature("balanceOf(address)", address(this))
        );
        if (!success) return 0;
        return abi.decode(data, (uint256));
    }

    // Reject direct ETH sends
    receive() external payable {
        revert("Use buyWithETH() or buyWithAllETH() function");
    }

    fallback() external payable {
        revert("Function not found");
    }
}

